import './App.css';

function App() {
  return (
    <div className="App">
      {/* <div id="navbar"> */}
        <div class="logo">
          <img id="go" src="imageva/LOGO.jpeg" alt="no" />
        </div>
        <div class="search">
          <input type="text" placeholder="🔍 Type Something.." background-color="grey" />
        </div>
        <div class="links">
          <a href="">Home</a>
          <a href="">Browse</a>
          <a href="">Details</a>
          <a href="">Streams</a>
          <div class="prof">
            <a href="">Profile</a>
            <img id="profileimg" src="imageva/images.jpg" alt="no" width="40px" height="40px" />
          </div>
        </div>
      </div>
      );
}

      export default App;
